import { Link } from 'react-router-dom';
import './header.styles.scss';

const Header = () => {
    return (
        <nav className='nav-menu container'>
            <div className='logo'>
                <Link to='/'>DIPSON ONLINE- SHOPPING</Link>
            </div>
            <ul>
                <li>
                <Link to='/'>
                    Home
                </Link>
                </li>

                <li>
                <Link to='/'>
                    Shop
                </Link>
                </li>  
            </ul>

        </nav>
    )
}

export default Header;
